import React from 'react';


const Card = ({ img, name, num, id, types}) => {
    return (
        <div className='tc bg-white dib br3 pa3 ma2 grow bw2 shadow-5 card'>
            <img src={`${img}`} alt={`pokemon${id}`}/>
            <div>
                <h2 className='card-text'>{num}. <strong>{name}</strong></h2>
                <h2 className='card-text'>Type: {!types[1] ? types[0] : types[0] + ', ' + types[1]}</h2>
            </div>
        </div>

    )
}

export default Card
